const ContactUs = () =>{
    return(
        <div style={{display:'flex', justifyContent:'center', alignItems:'center', flex:1, position:'fixed', width:'100%', height:'100%'}}>
            <h2>Contact Page</h2>
            {/* <Calendar /> */}
        </div>
    );
}
